/* ==UserStyle==
@name           PimEyes Crack
@namespace      github.com/PinkDev1/PimEyes-Crack-UserStyle
@version        2.0.0
@description    Allows easier use of the FREE version of PimEyes
@author         PinkDev1
==/UserStyle== */

@-moz-document url-prefix("https://pimeyes.com/en/search") {

    /*Un-blur the URLs*/
    .blurred-source-url{
        user-select: all !important;;
    }

    /*Make the URLs selectable, and visible*/
    span{
        filter: none !important;;
        overflow: visible !important;;
        user-select: initial !important;;
        max-width: initial !important;;
        pointer-events: none !important;;
    }

    /*Remove the Buy Premium overlay on images*/
    .zoom {
        display: none !important;;
    }

    /*Remove the actions menu, so we can select the image*/
    .actions {
        display: none !important;;
    }


    /*Hide UNLOCK buttons*/
    button[type="button"] {
        display: none !important;;
    }

    /*un-ide add picture button*/
    button[class="spacer"] {
        display: inherit !important;;
    }

}

